\" , y = expression(paste(\"Avg. Concentration in\" , \" (\\u03bcg/m\"^\"3\",\")\")), title = \"Comparision of States and its Pollutants\")"]},{"cell_type":"markdown","id":"b72dd089","metadata":{"papermill":{"duration":0.013789,"end_time":"2024-07-27T11:07:56.807809","exception":false,"start_time":"2024-07-27T11:07:56.79402","status":"completed"},"tags":[]},"source":["**Trends of SO2, NO2, RSPM AND SPM pollutants in three states from 2003 to 2010**"]},{"cell_type":"code","execution_count":9,"id":"8872351f","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2024-07-27T11:07:56.840005Z","iopub.status.busy":"2024-07-27T11:07:56.838155Z","iopub.status.idle":"2024-07-27T11:07:57.081223Z","shell.execute_reply":"2024-07-27T11:07:57.079222Z"},"papermill":{"duration":0.262993,"end_time":"2024-07-27T11:07:57.084842","exception":false,"start_time":"2024-07-27T11:07:56.821849","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'state'. You can override using the\n","`.groups` argument.\n","\u001b[1m\u001b[22m`summarise()` has grouped output by 'state'. You can override using the\n","`.groups` argument.\n","\u001b[1m\u001b[22m`summarise()` has grouped output by 'state'. You can override using the\n","`.groups` argument.\n","\u001b[1m\u001b[22m`summarise()` has grouped output by 'state'. You can override using the\n","`.groups` argument.\n"]}],"source":["#Creating data frame with values of pollutants and their yearly avg.\n","# FOR SO2\n","df_meanso2 <- data_sampled %>% \n","  group_by(state, year) %>% \n","  summarise(avg_so2 = mean(so2))\n","\n","# FOR NO2\n","df_meanno2 <- data_sampled %>% \n","  group_by(state, year) %>% \n","  summarise(avg_no2 = mean(no2))\n","\n","# FOR RSPM\n","df_meanrspm <- data_sampled %>% \n","  group_by(state, year) %>% \n","  summarise(avg_rspm = mean(rspm))\n","\n","# FOR SPM\n","df_meanspm <- data_sampled %>% \n","  group_by(state, year) %>% \n","  summarise(avg_spm = mean(spm))\n","\n","#Using join function to create the main table \n","mean_table <- inner_join(df_meanso2, df_meanno2, by = c(\"state\", \"year\")) %>% \n","  inner_join(df_meanrspm, by = c(\"state\", \"year\")) %>% \n","  inner_join(df_meanspm, by = c(\"state\", \"year\"))\n","\n","#for the trends of pollutants over time\n","meanofpollutants_per_year <- mean_table %>% \n","  group_by(year) %>% \n","  summarise(total_avg_so2 = mean(avg_so2), total_avg_no2 = mean(avg_no2), total_avg_rspm = mean(avg_rspm), total_avg_spm = mean(avg_spm))"]},{"cell_type":"markdown","id":"8fac998f","metadata":{"papermill":{"duration":0.014428,"end_time":"2024-07-27T11:07:57.114088","exception":false,"start_time":"2024-07-27T11:07:57.09966","status":"completed"},"tags":[]},"source":["**Sulphur Dioxide (SO2)**\n","\n","SO2 is a toxic gas that is released primarily from burning fossil fuels, such as coal and oil, in industrial processes and power generation. Its emissions contribute to the formation of acid rain, which has detrimental effects on soil, water bodies, vegetation, and buildings. Acid rain can also harm aquatic ecosystems, including fish and other aquatic organisms.\n","\n","SO2 can cause respiratory problems, such as coughing, wheezing, and shortness of breath, especially in individuals with pre-existing respiratory conditions like asthma. It can also worsen existing heart and lung conditions.\n"]},{"cell_type":"markdown","id":"b6838e92","metadata":{"papermill":{"duration":0.014196,"end_time":"2024-07-27T11:07:57.142511","exception":false,"start_time":"2024-07-27T11:07:57.128315","status":"completed"},"tags":[]},"source":["**1.  \tSO2 trend from 2004 to 2010**"]},{"cell_type":"code","execution_count":10,"id":"23226a9b","metadata":{"execution":{"iopub.execute_input":"2024-07-27T11:07:57.175386Z","iopub.status.busy":"2024-07-27T11:07:57.173571Z","iopub.status.idle":"2024-07-27T11:07:57.499077Z","shell.execute_reply":"2024-07-27T11:07:57.49617Z