"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Plotting Trend of RSPM for each state\n","ggplot(mean_table, \n","       aes(x = year, y = avg_rspm, color = state)) + geom_text(aes(label = round(avg_rspm, 1)), vjust = -0.5) +\n","  geom_line(size = 0.5) + geom_point() +\n","  labs(x = \"Year\", y = expression(paste(\"Avg. RSPM\", \" (\\u03bcg/m\"^\"3\",\")\")), title = \"Trend of Respirable Suspended Particulate Matter (RSPM)\", subtitle = \"states : Maharashtra , Rajastan, Uttarpradesh\", caption = \"Maximum permissible Limit = 120 micrograms per cubic meter\") + \n","  geom_hline(yintercept = 120, linetype = \"dashed\", color = \"red\")"]},{"cell_type":"markdown","id":"831d5dcd","metadata":{"papermill":{"duration":0.024793,"end_time":"2024-07-27T11:08:00.240555","exception":false,"start_time":"2024-07-27T11:08:00.215762","status":"completed"},"tags":[]},"source":["**Suspended Particulate Matter (SPM)**\n","\n","SPM refers to solid particles suspended in the air, including both PM10 and larger particles. It can come from various sources, such as construction and demolition activities, burning of biomass and waste, and industrial processes.\n","\n","SPM can have detrimental effects on air quality, visibility, and human health. It can cause respiratory problems, eye and throat irritation, and damage to vegetation, buildings, and infrastructure.\n"]},{"cell_type":"markdown","id":"334588bc","metadata":{"papermill":{"duration":0.02384,"end_time":"2024-07-27T11:08:00.28803","exception":false,"start_time":"2024-07-27T11:08:00.26419","status":"completed"},"tags":[]},"source":["**1.\tSPM trend from 2004 to 2010**"]},{"cell_type":"code","execution_count":16,"id":"d839a08c","metadata":{"execution":{"iopub.execute_input":"2024-07-27T11:08:00.340595Z","iopub.status.busy":"2024-07-27T11:08:00.338768Z","iopub.status.idle":"2024-07-27T11:08:00.641441Z","shell.execute_reply":"2024-07-27T11:08:00.639353Z"},"papermill":{"duration":0.331947,"end_tim